import React from "react";

import HelmetResumen from "../components/Helmet/HelmetResumen";

function Contacto() {

			
	var contactData = {
		imagenContacto:
			"https://ouch-cdn2.icons8.com/P19jWqo45-M3Q3dieM4f3lLzv_ug_oYqNvORdXMSAfY/rs:fit:433:456/czM6Ly9pY29uczgu/b3VjaC1wcm9kLmFz/c2V0cy9zdmcvMjE3/LzU0MDcyZGQ5LTZk/NjYtNDZhZS05NzNj/LWViZWY2NTdjNmQ1/ZS5zdmc.png",
		nombre: "Contacto :D"
	};

	return (
		<section className="contacto">
			<HelmetResumen title="Contacto" />
			<h2>Contacto</h2>
			
			
			
			
			
			
			


	return <img src={contactData.imagenContacto} alt={contactData.nombre} />;
			
			
			
			
			
			
			
			
			
			
			
			

		</section>
	);
}

export default Contacto;
